script: |
  super -f text -I q11453.spq | sort > q11453.out

inputs:
  - name: q11453.spq
    data: |
      SELECT DISTINCT col2 * + 66 + - ( + ( - col0 ) ) AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - ( + - col2 ) * - + 67 ) BETWEEN col2 AND - col1 * + col0 + + col0;
  - name: tab0

outputs:
  - name: q11453.out
    data: |
      3117
      6631
      747
